        });

            y: [newTheme, newSpy, newTheme] 
        }, [0, 1, 2]);
    }
    
    var checkExist = setInterval(function() {
       if (document.getElementsByClassName('plotly-graph-div').length) {
          gd = document.getElementsByClassName('plotly-graph-div')[0];
          setupLogic();
          clearInterval(checkExist);
       }
    }, 100);
    </script>
